import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";
import styled from "styled-components";
import axios from "axios";

const Post = () => {
  let { post_pk } = useParams();
  const [postDetail, setPostDetail] = useState({});
  //console.log(post_pk);
  const axios_GetPost_Detail = async () => {
    await axios.get("../data/Post.json").then((el) => {
      console.log(el);
    });
  };
  useEffect(() => {
    axios_GetPost_Detail();
  }, []);
  return (
    <Container>
      <Nav>
        <img className="arrow" src={"./arrow-left.svg"} alt="back-arrow"></img>
        <div className="arrow-explain">글 목록으로</div>
      </Nav>
      <Header></Header>
    </Container>
  );
};
export default Post;
const Container = styled.div`
  display: flex;
  position: relative;
  flex-direction: column;
  border: solid grey 1px;
  border-radius: 10px;
  width: 360px;
  height: 821px;
`;
const Nav = styled.div`
  display: flex;
  flex-direction: row;
  .arrow {
    width: 18px;
    height: 18px;
    margin: 21px 11px 10px 21px;
    cursor: pointer;
  }
  .arrow-explain {
    margin-top: 21px;
    font-size: 14px;
    font-weight: 700;
    line-height: 15px;
    color: #b4b4b4;
  }
`;
const Header = styled.div``;
